sum_transaction_by_account.map:
function (doc) {
                const id = doc._id 
                if (id.slice(5, 18) == '_transaction_') {
                  emit(
                    [
                      id.slice(2, 5), 
                      doc.account, 
                      doc.cleared
                    ], 
                    doc.value
                  )
                }
              }

sum_transaction_by_budget.map:
function (doc) {
                const id = doc._id
                if (id.slice(5, 18) == '_transaction_') {
                  emit(
                    [
                      id.slice(2, 5), 
                      doc.date.slice(0, 7),
                      doc.category
                    ], 
                    doc.value
                  )
                }
              }

transactions_by_account.map:
function (doc) {
                  const id = doc._id
                  if (id.slice(5, 18) == '_transaction_') {
                    emit([
                      id.slice(2, 5), 
                      doc.account,
                      id.slice(-12)
                    ]) 
                  }
                }

transactions_by_import_id.map:
function(doc) {
                  const id = doc._id
                  if (id.slice(5, 18) == '_transaction_') {
                    emit([
                      id.slice(2, 5), 
                      doc.account,
                      doc.importId,
                    ])
                  }
                }
